def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    indexer = np.concatenate([block.mgr_locs.as_array for block in data.blocks])

    for block in data.blocks:
        try:
            result, _ = self.grouper.aggregate(
                block.values, how, axis=1, min_count=min_count
            )
        except NotImplementedError:
            if alt is not None:
                obj = self.obj[block.items].iloc[:, 0]
                s = get_groupby(obj, self.grouper)
                result = s.aggregate(lambda x: alt(x, axis=self.axis))
                result = cast(DataFrame, result)
                result = result._data.blocks[0].values
                result = result.reshape(1, -1) if isinstance(result, np.ndarray) and result.ndim == 1 else result
            else:
                raise
        agg_blocks.append(block.make_block(result))

    if not agg_blocks:
        raise DataError("No numeric types to aggregate")

    # Reset the block locations and items
    for i, blk in enumerate(agg_blocks):
        loc = len(blk.mgr_locs)
        blk.mgr_locs = indexer[:loc]
        indexer = indexer[loc:]

    return agg_blocks, data.items
